import React from 'react';
import { connect } from 'dva';
import { ConnectState } from '@/models/connect';
import Cards from '@/components/Cards';
import styles from './index.scss';
import router from 'umi/router';

// @ts-ignore
@connect(({ global }) => ({
  global,
}))

// eslint-disable-next-line react/prefer-stateless-function,@typescript-eslint/class-name-casing
class applicatioScenario extends React.Component {
  state = {
    searchResult: '',
    applicatioScenarioGroup: [
      '城市治理',
      '社区治理',
      '公共安全',
      '宏观决策',
      '生态环境',
      '应急处理',
      '园区管理',
      '产业经济',
      '智慧教育',
    ],
    imageList: [
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'https://ss1.bdstatic.com/70cFvXSh_Q1YnxGkpoWK1HF6hhy/it/u=1253400475,2484267000&fm=26&gp=0.jpg',
      'https://ss1.bdstatic.com/70cFuXSh_Q1YnxGkpoWK1HF6hhy/it/u=4206255152,3839863513&fm=26&gp=0.jpg',
      'data:image/jpeg;base64,',
      'https://ss1.bdstatic.com/70cFvXSh_Q1YnxGkpoWK1HF6hhy/it/u=2915606125,1192007706&fm=26&gp=0.jpg',
      'data:image/jpeg;base64,',
      'https://ss3.bdstatic.com/70cFv8Sh_Q1YnxGkpoWK1HF6hhy/it/u=3945705326,2691261047&fm=26&gp=0.jpg',
    ],
  };

  gotoIndex = () => {
    router.push('/index');
  };

  routerButtonClick = (name: string) => {
    // @ts-ignore
    const { dispatch } = this.props;
    dispatch({
      type: 'global/saveSolutionRouter',
      state: this.state,
      payload: name,
    });
    router.push(`/applicatioScenarioNext/${name}`);
  };

  render() {
    const { applicatioScenarioGroup, searchResult, imageList } = this.state;
    const { solutionGroup } = this.props;
    return (
      <div className="overview">
        <div>
          <h1
            style={{
              marginLeft: '1.5%',
              fontSize: '24px',
              color: 'rgba(255, 255, 255, 0.65)',
              fontWeight: 'bold',
            }}
          >
            智慧城市应用{' '}
            <span className={styles.gotoIndex} onClick={this.gotoIndex}>
              前往主页
            </span>
          </h1>
        </div>
        <div className={styles.resultWrap}>
          {// eslint-disable-next-line consistent-return,array-callback-return
          applicatioScenarioGroup.map((item, index) => {
            // eslint-disable-next-line react/jsx-no-bind
            if (!searchResult || applicatioScenarioGroup[index].indexOf(searchResult) !== -1) {
              // eslint-disable-next-line react/jsx-no-bind
              // @ts-ignore
              // eslint-disable-next-line max-len,react/jsx-no-bind
              const groups = solutionGroup.filter((gitem) => {return gitem.name === item})[0].solutionSonGroup;
              const realnum = groups.filter(ritem => {return ritem.state === 'real'}).length;
              const solutionnum = groups.filter(sitem => {return sitem.state === 'solution'}).length;
              const simulationnum = groups.filter(sitem => {return sitem.state === 'simulation'}).length;
              return (
                <Cards
                  ischildrenCard={false}
                  content={applicatioScenarioGroup[index]}
                  opacityTime={parseInt(index) * 100}
                  handleClick={this.routerButtonClick.bind(this, applicatioScenarioGroup[index])}
                  src={imageList[index]}
                  rnum={realnum}
                  snum={solutionnum}
                  sinum={simulationnum}
                />
              );
            } else {
              return null;
            }
          })}
        </div>
      </div>
    );
  }
}
export default connect(({ global }: ConnectState) => ({
  solutionRouter: global.solutionRouter,
  solutionGroup: global.solutionGroup,
}))(applicatioScenario);
